@JonZarate im still going to write in english in case someone has the same problem :p  

The first step is to obtain your password, you can obtain it with WART or with the API using the exampleRegister.php file.

The registration procedure is simple. The client sends the number and identity, the server will respond if you know or not. If unknown, the client sends its number and token associated with that number. The server verifies the token. Now the client send its number, identity and sms code. The server finally return the password.

The RC4 keys are for client-server communications,  2 for client and 2 for the server.

**Last Seen example**
```php
<?php
require_once 'whatsprot.class.php';

////////////////CONFIGURATION///////////////////////
////////////////////////////////////////////////////
$username = "";      // your number with cc          
$password = "";      // password obtained with WART or API
$identity = "";         // not required, only important during registration (as i explained above)
$nickname = ""; 
$debug = true;                        
/////////////////////////////////////////////////////
$target = "" ; // Number with cc (to test lastseen)

$w = new WhatsProt($username, $identity, $nickname, $debug);

$w->connect();
$w->loginWithPassword($password);
$w->sendClientConfig();
$w->sendGetServerProperties();

$w->sendGetRequestLastSeen($target);

// You can bind the event and use your own function

?>

